import React from 'react';
import Td_zag from "./td_zag";
import Td_first from "./td_first";

const Result = () => {
    return (
        <div className="w-[1596px] h-[721px] py-5 flex-col justify-start items-center inline-flex">
            <div className="self-stretch h-[146px] px-[250px] flex-col justify-start items-start gap-5 flex">
                <div className="self-stretch text-center text-white text-5xl font-semibold font-['Sora'] leading-[72px]">Результаты
                    этапов
                </div>
            </div>
            <div className="self-stretch h-[535px] px-[135px] pb-5 flex-col justify-start items-start gap-[30px] flex">
                <div className="self-stretch h-[515px] p-[50px] rounded-[20px] border border-stone-900 flex-col justify-start items-start gap-[50px] flex">
                    <div className="self-stretch h-[415px] flex-col justify-start items-start gap-[50px] flex">
                        <div className="self-stretch h-[415px] flex-col justify-center items-center gap-5 flex">
                            <div className="self-stretch justify-between items-center inline-flex">
                                <div className="w-[260px] h-[65px] pl-6 pr-4 py-4 bg-stone-950 rounded-[15px] flex-col justify-center items-start gap-6 inline-flex">
                                    <div className="self-stretch justify-start items-center gap-6 inline-flex">
                                        <div className="grow shrink basis-0 flex-col justify-start items-start gap-1 inline-flex">
                                            <div className="opacity-50 text-white text-lg font-bold font-['Raleway']">Год
                                            </div>
                                            <div className="text-white text-2xl font-medium font-['Raleway']">Ничего не выбрано
                                            </div>
                                        </div>
                                        <div className="w-6 h-6 relative">
                                            <div className="w-6 h-6 left-0 top-0 absolute">
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="w-[260px] h-[65px] pl-6 pr-4 py-4 bg-stone-950 rounded-[15px] flex-col justify-center items-start gap-6 inline-flex">
                                    <div className="self-stretch justify-start items-center gap-6 inline-flex">
                                        <div className="grow shrink basis-0 flex-col justify-start items-start gap-1 inline-flex">
                                            <div className="opacity-50 text-white text-lg font-bold font-['Raleway']">Этап
                                            </div>
                                            <div className="text-white text-2xl font-medium font-['Raleway']">Ничего не выбрано
                                            </div>
                                        </div>
                                        <div className="w-6 h-6 relative">
                                            <div className="w-6 h-6 left-0 top-0 absolute">
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="w-[260px] h-[65px] pl-6 pr-4 py-4 bg-stone-950 rounded-[15px] flex-col justify-center items-start gap-6 inline-flex">
                                    <div className="self-stretch justify-start items-center gap-6 inline-flex">
                                        <div className="grow shrink basis-0 flex-col justify-start items-start gap-1 inline-flex">
                                            <div className="opacity-50 text-white text-lg font-bold font-['Raleway']">Класс
                                            </div>
                                            <div className="text-white text-2xl font-medium font-['Raleway']">Ничего не выбрано
                                            </div>
                                        </div>
                                        <div className="w-6 h-6 relative">
                                            <div className="w-6 h-6 left-0 top-0 absolute">
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div className="w-[178px] h-[65px] px-8 py-4 bg-stone-950 rounded-[15px] justify-center items-center gap-2.5 flex">
                                    <div className="text-white text-xl font-bold font-['Inter'] uppercase">Показать
                                    </div>
                                </div>
                            </div>
                            <div className="text-center text-white text-[32px] font-semibold font-['Inter'] tracking-wider">Финал г. Волгоград, 2023 Класс SPL Sedan
                            </div>
                            <div className="rounded-[20px] flex-col justify-center items-center flex">
                                <table className="bg-neutral-900 rounded-[20px] border border-zinc-600 flex-col justify-center items-center flex">
                                    <tr className="self-stretch bg-white bg-opacity-0 rounded-[10px] justify-center items-center inline-flex">
                                        <Td_zag isPlace={1} data={"№"}/>
                                        <Td_zag isPlace={2} data={"Участник"}/>
                                        <Td_zag isPlace={3} data={"Результат"}/>
                                        <Td_zag  data={"Команда"}/>
                                        <Td_zag  data={"Бренд сабвуфера/динамиков"}/>
                                        <Td_zag  data={"Бренд усилителей"}/>
                                        <Td_zag  data={"Питание"}/>
                                    </tr>
                                    <tr className="self-stretch bg-white bg-opacity-0 justify-center items-center inline-flex">
                                        <Td_first isPlace={1} data={"003"}/>
                                        <Td_first isPlace={2} data={"Shvardigulin Evgenyi"}/>
                                        <Td_first isPlace={3} data={"157,4"}/>
                                        <Td_first data={"Global Team"}/>
                                        <Td_first data={"DST"}/>
                                        <Td_first data={"DST"}/>
                                        <Td_first data={"DST"}/>

